import numpy

class Solution:
    def reductionOperations(self, nums: list[int]) -> int:
        nums = numpy.array(nums, dtype="i4")
        nums[::-1].sort()
        largest = nums[0]
        smallest = nums[-1]
        nums = nums[:-(nums == smallest).sum()]
        num_operations = 0
        prev = 0
        while largest != smallest:
            num_largest = (nums == largest).sum()
            num_operations += num_largest + prev
            prev += num_largest
            nums = nums[num_largest:]
            try:
                largest = nums[0]
            except:
                largest = smallest
        return num_operations


